function main_loading() {
    min_max = document.getElementById('year-input').value.split(",");
    min = parseInt(min_max[0]);
    max = parseInt(min_max[1]);
    if ( Number.isNaN(min) ) { min = Number.MIN_VALUE ; }
    if ( Number.isNaN(max) ) { max = Number.MAX_VALUE ; }

    var uni_coord = load_uni_coord();
    // var uni_network = load_uni_network(start_time=min, end_time=max);
    var uni_network = load_uni_network('ALL', 'ALL', min, max);

    var convertData = function (coord_data) {
        var res = [];
        for (var i = 0; i < coord_data.length; i++) {
              res.push({
                  name: coord_data[i][0],
                  value: [coord_data[i][1], coord_data[i][2]]
              });
        }
        return res;
    };

    function getUniCoord(idx){
      return [uni_coord[idx][1], uni_coord[idx][2]];
    }

    var network = uni_network.map( (collaboration) => {
      return [
         getUniCoord(collaboration[0]),
         getUniCoord(collaboration[1])
      ]
    });

    var geo3d_option = {
        map: 'world',
        shading: 'realistic',
        silent: true,
        environment: '#333',
        realisticMaterial: {
            roughness: 0.8,
            metalness: 0
        },
        postEffect: {
            enable: true
        },
        groundPlane: {
            show: false
        },
        light: {
            main: {
                intensity: 1,
                alpha: 30
            },
            ambient: {
                intensity: 0
            }
        },
        viewControl: {
            distance: 70,
            alpha: 89,

            panMouseButton: 'left',
            rotateMouseButton: 'right'
        },

        itemStyle: {
            areaColor: '#323c48',
            borderColor: '#111',
            borderWidth: 0.5
        },
        regionHeight: 0.2
    };

    var lines3d_series_option = {
        type: 'lines3D',
        coordinateSystem: 'geo3D',
        effect: {
            show: true,
            trailWidth: 1,
            trailOpacity: 0.5,
            trailLength: 0.2,
            constantSpeed: 1
        },
        blendMode: 'lighter',
        lineStyle: {
            width: 4,
            opacity: 0.05,
            color: 'rgba(180, 60, 90, 0.8)'
        },
        data: network
    }

    var scatter3d_series_option = {
              name: 'uni_point',
              type: 'scatter3D',
              coordinateSystem: 'geo3D',
              data: convertData(uni_coord),
              symbolSize: 7,
              label: {
                  normal: {
                      formatter: '{b}',
                      position: 'right',
                      show: false
                  },
                  emphasis: {
                      show: true
                  }
              },
              itemStyle: {
                  color: 'rgba(180, 60, 90, 0.8)'
              }
          };

    myChart.setOption({
        geo3D: geo3d_option,
        series: [lines3d_series_option, scatter3d_series_option]
      });

    myChart.on('click', function(params){
      uni_name = params["data"]["name"]
      drawChart(uni_name);
    });
    //
    // window.addEventListener('keydown', function () {
    //     myChart.dispatchAction({
    //         type: 'lines3DToggleEffect',
    //         seriesIndex: 0
    //     });
    // });
}
